Ext.data.JsonP['Alloy_1.7.34_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Alloy 1.7.34 - 24 February 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-46246195\" class=\"content\">\n                        <h1>Alloy 1.7.34 - 24 February 2016</h1>\n    <p>Alloy 1.7.34 is a patch release that includes new features, improvements and bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-46246195_Alloy1.7.34ReleaseNote-NewFeatures\">\n        <h2 class=\"heading \"><span>New Features</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1356\" target=\"_blank\">ALOY-1356</a> and <a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1357\" target=\"_blank\">ALOY-1357</a> - Support for defining the  <tt class=\" \">Ti.UI.iOS.LivePhotoView</tt> and <tt class=\" \">Ti.UI.iOS.MenuPopup</tt> in XML    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46246195_Alloy1.7.34ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1352\" target=\"_blank\">ALOY-1352</a> - The methods <tt class=\" \">dpToPX</tt> and <tt class=\" \">pxToDP</tt> of the measurement module support HD Retina iOS    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46246195_Alloy1.7.34ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1297\" target=\"_blank\">ALOY-1297</a> - Cannot use localized strings for AlertDialog ButtonNames in XML    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1355\" target=\"_blank\">ALOY-1355</a> - Alloy doesn&apos;t cast &quot;true&quot;/&quot;false&quot; attributes as booleans    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46246195\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Alloy 1.7.34 Release Note"});